import React from "react";

const hour = new Date().getHours()
const minute = new Date().getMinutes()
const second = new Date().getSeconds()

const date = new Date().getSeconds()

const food = [
    {
        id:1,
        name:"جوجه کباب زعفرانی",
        oldPrice:130000
    }
]

console.log(date);

const ZoodParty = () => {
  return (
    <sectiont>
      <div className="foodParty">
        <div className="foodParty-title">
          <h2>فود پارتی</h2>
          <div className="foodPart-timer">
            <p>{second}</p>:
            <p>{minute}</p>:
            <p>{hour}</p>
          </div>
        </div>
        <div className="foodParty-items">
            <div className="foodParty-items_cart">
                <div className="foodParty-items_cart_img"></div>
            </div>
        </div>
      </div>
    </sectiont>
  );
};

export default ZoodParty;
